define('text!views/todo.html',[],function () { return '<section>\r\n    <h2 class="page-title" data-bind="text: title"></h2>\r\n\r\n    <ul>\r\n        <li>\r\n            Example of validation using the MetaData JayData brings down, as well as the ko observable checking validation on observable change<br />\r\n            <i>\r\n                *Notice the automatic validation if you try to edit the "Is Synchronized"" column from anything other than true or false\r\n            </i>\r\n        </li>\r\n        <li>\r\n            Example of using the built-in JayData adapters for local database storage, using IndexedDB, Web Sql, or localstorage\r\n        </li>\r\n    </ul>\r\n        \r\n    \r\n\r\n    <form class="column vform" id="addTaskForm" data-bind="submit: submitForm ">\r\n        <fieldset>\r\n            <legend>Add Todo</legend>\r\n            <input data-bind="value: taskInput" id="taskInput" />\r\n            <input type="submit" value="Add item" />\r\n        </fieldset>\r\n    </form>\r\n    <div class="column" style="float:left">\r\n        <h3>Local Task List <button class="btn-success" data-bind="click: synchronizeData">Manual Synchronize</button></h3>\r\n        \r\n        <table class="table table-striped">\r\n            <thead>\r\n                <tr>\r\n                    <th>Task</th>\r\n                    <th>Is Synchronized</th>\r\n                </tr>\r\n            </thead>\r\n            <tbody data-bind="foreach: localTodos">\r\n                <tr>\r\n                    <td><input data-bind="value:Task" /></td>\r\n                    <td><input data-bind="value: InSync" /></td>\r\n                </tr>\r\n            </tbody>\r\n        </table>\r\n\r\n    </div>\r\n    <div style="float:left; margin-right:40px"> &nbsp;</div>\r\n    <div class="column" style="float:left">\r\n        <h3>Remote Task List</h3>\r\n        \r\n        <table class="table table-striped">\r\n            <thead>\r\n                <tr>\r\n                    <th>Task</th>\r\n                    <th>Is Synchronized</th>\r\n                </tr>\r\n            </thead>\r\n            <tbody data-bind="foreach: remoteTodos">\r\n                <tr>\r\n                    <td data-bind="text:Task"></td>\r\n                    <td data-bind="text: InSync"></td>\r\n\r\n                </tr>\r\n            </tbody>\r\n        </table>\r\n\r\n\r\n    </div>\r\n   <div style="clear:both"></div>\r\n\r\n</section>';});

